NaiveLiftEltModp := function(alpha)
  p := #Parent(alpha);
  lift := Integers() ! alpha;
  if lift gt p/2 then return lift - p; else return lift; end if;
end function;

NaiveLiftCoeff := function(alpha, K)
  n := Degree(K);
  if n eq 1 then
    return K ! NaiveLiftEltModp(alpha);
  else
    elt := Eltseq(alpha);
    return &+[NaiveLiftEltModp(elt[i])*K.1^(i-1) : i in [1..n]];
  end if;
end function;

NaiveLiftPol := function(pol, K);
  d := Degree(pol);
  return PolynomialRing(K) ! [NaiveLiftCoeff(alpha, K) : alpha in Eltseq(pol)]; 
end function;

DeloneFaddeevModel := function(f)
  kx := BaseRing(Parent(f));
  FF := FunctionField(f);

  // COMPUTE REDUCED BASIS AND MAKE IT NORMAL
  red_bas := ShortBasis(DivisorGroup(FF) ! 0);
  M, h := Module(red_bas, kx :  IsBasis := true);
  prod := Inverse(h)(red_bas[2]*red_bas[3]);
  n_bas := [red_bas[1], red_bas[2] - prod[3], red_bas[3] - prod[2]];

  // APPLY DELONE-FADDEEV CORRESPONDENCE
  nM, nh := Module(n_bas, kx :  IsBasis := true);
  sq2 := Inverse(nh)(n_bas[2]^2); sq3 := Inverse(nh)(n_bas[3]^2);
  return Parent(f) !  [sq3[2], -sq3[3], sq2[2], -sq2[3]];
end function;

function lift_gonality_3(f)
  K := Rationals();
  f := DeloneFaddeevModel(f);
  //print "Took time", Cputime(tim);

  Rlift<x> := PolynomialRing(K);
  Slift<y> := PolynomialRing(Rlift);
  flift := NaiveLiftPol(Coefficient(f,3), K)*y^3 +
          NaiveLiftPol(Coefficient(f,2), K)*y^2 +
          NaiveLiftPol(Coefficient(f,1), K)*y +
          NaiveLiftPol(Coefficient(f,0), K);

  flift := y^3 + Coefficient(flift,2)*y^2
      + Coefficient(flift,1)*Coefficient(flift,3)*y
      + Coefficient(flift,0)*Coefficient(flift,3)^2; // MAKE MONIC
  return flift;
end function;

BhargavaQuadrics := function(f)
  kx := BaseRing(Parent(f)); frkx := FieldOfFractions(kx);
  Mkx := MatrixAlgebra(kx, 3);
  f0 := Coefficients(f)[1]; f1 := Coefficients(f)[2]; f2 := Coefficients(f)[3]; f3 := Coefficients(f)[4];
  fres := Parent(f) !  [-f3^2*f0 + 4*f0*f2 - f1^2, f1*f3 - 4*f0, -f2, 1];
  FF<Y> := FunctionField(f); FFres<Yres> := FunctionField(fres);
  // print "Genus of resolvent curve should be g + 1 which is", Genus(FFres) eq gf + 1;

  // COMPUTE REDUCED BASIS AND BASE CHANGES TO NAIVE BASES
  red_bas := ShortBasis(DivisorGroup(FF) ! 0);
  n_bas := [1, -f0*Y^(-1), Y, Y^2];
  red_bas_res := ShortBasis(DivisorGroup(FFres) !  0);
  n_bas_res := [1, Yres, Yres^2 - f2*Yres + f1*f3-4*f0];

  N, h := Module(n_bas, frkx :  IsBasis := true);
  Mres, hres := Module(red_bas_res, kx :  IsBasis := true);
  A := Matrix(frkx, 3, 3,
              [Inverse(h)(red_bas[i])[j] :  i in [2,3,4], j in [2,3,4]]);
  B := Matrix(frkx, 2, 2,
              [Inverse(hres)(n_bas_res[i])[j] :  i in [2,3], j in [2,3]]);

  // COMPUTE TERNARY QUADRATIC FORMS
  Q1 := Matrix(kx, 3, 3, [f0, 0, f1/2, 0, 1, -f3/2, f1/2, -f3/2 ,f2]);
  Q2 := Matrix(kx, 3, 3, [0, kx ! -1/2, f3/2, kx ! -1/2, 0, 0, f3/2, 0, 1]);
  Q1 := Transpose(A)*Q1*A; Q2 := Transpose(A)*Q2*A;
  return Mkx ! (B[1,1]*Q1 + B[1,2]*Q2), Mkx ! (B[2,1]*Q1 + B[2,2]*Q2);
end function;

MatrixToQuadric := function(Q)
  R := BaseRing(Q);
  S<y1,y2> := PolynomialRing(R,2);
  return Q[1][1]*y1^2 + 2*Q[1][2]*y1*y2 + 2*Q[1][3]*y1 + Q[2][2]*y2^2 + 2*Q[2][3]*y2 + Q[3][3];
end function;

function lift_gonality_4(f)
  K := Rationals();
  Q1, Q2 := BhargavaQuadrics(f);
//print "Took time", Cputime(tim);

  Rlift<x> := PolynomialRing(K);
  Q1lift := Matrix(Rlift, 3, 3, 
              [NaiveLiftPol(Q1[j][i], K) : i in [1,2,3], j in [1,2,3]]);
  Q2lift := Matrix(Rlift, 3, 3,
              [NaiveLiftPol(Q2[j][i], K) : i in [1,2,3], j in [1,2,3]]);

  // PROJECT DOWN AND MAKE MONIC



  Slift<y> := PolynomialRing(Rlift);
  SSlift<y1,y2> := PolynomialRing(Rlift,2);
  philift := hom<SSlift -> Slift | 0, y>;

  f1lift := SSlift ! MatrixToQuadric(Q1lift);
  f2lift := SSlift ! MatrixToQuadric(Q2lift);

  print "Computing resultant...";
  //tim := Cputime();
  flift := philift(Resultant(f1lift,f2lift,1));
  //print "Took time", Cputime(tim);

  flift := y^4 + Coefficient(flift,3)*y^3
      + Coefficient(flift,2)*Coefficient(flift,4)*y^2
      + Coefficient(flift,1)*Coefficient(flift,4)^2*y
      + Coefficient(flift,0)*Coefficient(flift,4)^3; // MAKE MONIC
  return flift;
end function;


dualBasis := function(b)
  K := Parent(b[1]);
  frkx := BaseField(K);
  n := #b;
  C := ZeroMatrix(frkx, n^2, n^2);
  w := Vector(frkx, [0 : i in [1..n^2]]);
  for i in [1..n] do
    for j in [1..n] do
      for l in [1..n] do
        C[n*(i-1)+j, n*(j-1)+l] := Trace(b[i]*b[l]);
        if i eq j then w[n*(i-1)+j] := 1; end if; 
      end for;
    end for;
  end for;
  sol := Solution(C,w);
  db := [&+[sol[n*(j-1)+l]*b[l] : l in [1..n]] : j in [1..n]];
  return db;
end function;

BhargavaMatrices := function(f);
  kx := BaseRing(Parent(f)); frkx := FieldOfFractions(kx);
  fres := CayleyResolvent(f);
  FF<Y> := FunctionField(f); FFres<Yres> := FunctionField(fres);
  gfres := Genus(FFres);
  // if following test fails, cover is not simply branched
  // print "Genus of resolvent curve is", gfres, "which equals 3g + 7:", gfres eq 3*gf+7;
  FFf := FunctionField(f); gf := Genus(FFf);
  if gfres ne 3*gf+7 then
    print "Cover not simply branched";
    error "Cover not simply branched";
  end if; 
  print "----";

  // computing altered fundamental resolvent map
  Mo := FundamentalResolventMatrices(f);
  print "Computed altered fundamental resolvent matrices";

  // computing reduced bases and their duals
  sb, hess := ShortBasis(DivisorGroup(FF) ! 0);
  sbres, hessres := ShortBasis(DivisorGroup(FFres) ! 0);
  dsb := dualBasis(sb);
  dsbres := dualBasis(sbres);

  b := [1,Y,Y^2,Y^3,Y^4]; //naive basis for FF
  N, h := Module(dsb, frkx : IsBasis := true);
  bres := [1,Yres,Yres^2,Yres^3,Yres^4,Yres^5]; //naive basis for FFres
  Nres, hres := Module(bres, frkx : IsBasis := true);

  //Computing the constant factor
  Ndisc, hdisc := Module(b, frkx : IsBasis := true);
  discmatr := Matrix(frkx, 5,5, [Inverse(hdisc)(sb[i])[j] : i in [1,2,3,4,5], j in [1,2,3,4,5]]); //change of basis from sb to b
  const := Determinant(discmatr); //The determinant of this matrix is (disc k[C]_0 / disc f)^(1/2)

  //Step 4: change of basis matrix
  A := Matrix(frkx, 5,5, [Inverse(h)(b[i])[j] : i in [1,2,3,4,5], j in [1,2,3,4,5]]); //Change of basis from b to dsb
  B := Matrix(frkx, 5,5, [Inverse(hres)(dsbres[i])[j] : i in [2,3,4,5,6], j in [2,3,4,5,6]]); //change of basis from dsbres to bres

  //Step 5: apply the action
  basechangedMo := [ZeroMatrix(frkx, 5,5) : i in [0..4]];
  for i in [1..5] do
    basechangedMo[i] := Transpose(B)*Mo[i]*B;
  end for;

  newMo := [ZeroMatrix(frkx, 5,5) : i in [0..4]];
  for i in [1..5] do
    for j in [1..5] do
      newMo[i] := newMo[i] + const*A[i,j]*basechangedMo[j];
    end for;
  end for;

  print "Applied base change to obtain genuine fundamental resolvent matrices";
  print "----";

  //The model is a Pfaffian model defined by newMo[2],newMo[3],newMo[4],newMo[5]
  kx5x5 := Parent(ZeroMatrix(kx,5,5));

  return kx5x5 ! newMo[2],
         kx5x5 ! newMo[3],
         kx5x5 ! newMo[4],
         kx5x5 ! newMo[5];
end function;

function lift_gonality_5(f)
  K := Rationals();
  M1, M2, M3, M4 := BhargavaMatrices(f);

  Rlift<X> := PolynomialRing(K);

  M1lift := ZeroMatrix(Rlift, 5, 5);
  for i in [1..5] do for j in [i+1..5] do
    M1lift[i][j] := NaiveLiftPol(M1[i][j], K);
    M1lift[j][i] := -M1lift[i][j];
  end for; end for;
  M2lift := ZeroMatrix(Rlift, 5, 5);
  for i in [1..5] do for j in [i+1..5] do
    M2lift[i][j] := NaiveLiftPol(M2[i][j], K);
    M2lift[j][i] := -M2lift[i][j];
  end for; end for;
  M3lift := ZeroMatrix(Rlift, 5, 5);
  for i in [1..5] do for j in [i+1..5] do
    M3lift[i][j] := NaiveLiftPol(M3[i][j], K);
    M3lift[j][i] := -M3lift[i][j];
  end for; end for;
  M4lift := ZeroMatrix(Rlift, 5, 5);
  for i in [1..5] do for j in [i+1..5] do
    M4lift[i][j] := NaiveLiftPol(M4[i][j], K);
    M4lift[j][i] := -M4lift[i][j];
  end for; end for;

  Rlift<x> := PolynomialRing(K);
  Slift<y> := PolynomialRing(Rlift);
  SSlift<y1,y2,y3> := PolynomialRing(Rlift,3);
  philift := hom<SSlift -> Slift | 0, 0, y>;

  Mlift := ZeroMatrix(SSlift,5,5);
  Mlift := M1lift + M2lift*y3 + M3lift*y2 + M4lift*y1;

  print "Lifted to characteristic zero, now projecting to plane";


  flift := philift(Basis(EliminationIdeal(Ideal(Pfaffians(Mlift, 4)),2))[1]);

  print "Clearing denominators...";
  // clear denominators;
  listofdenoms := [];
  for c in Coefficients(flift) do
    listofdenoms cat:=[Denominator(cc) : cc in Coefficients(c)];
  end for;
  flift *:= LCM(listofdenoms);

  print "Making monic...";

  flift := y^5 + Coefficient(flift,4)*y^4
          + Coefficient(flift,3)*Coefficient(flift,5)*y^3
          + Coefficient(flift,2)*Coefficient(flift,5)^2*y^2
          + Coefficient(flift,1)*Coefficient(flift,5)^3*y
          + Coefficient(flift,0)*Coefficient(flift,5)^4; // MAKE MONIC
  return flift;
end function;
